export const isLoggedIn = () => {
    return {
        type: 'IS_LOGGED_IN'
    }
}

export const asyncRegister = (formData) => {
    return (dispatch) => {
        axios.post()
    }
}

export const register = () => {
    return {
        type: 'REGISTER'
    }
}
